import React from 'react';
import classes from './footer.module.css';

function Footer(props) {
    return(
        <div className={classes.footr}>
            <div>
                <ul>ONLINE SHOPPING
                    <li>Men</li>
                    <li>Women</li>
                    <li>Kids</li>
                </ul>
            </div>
        </div>
    );
}

export default Footer;
